def count_divisors(n):
    count = 0
    for i in range(1, n+1):
        if n % i == 0:
            count += 1
    return count

def find_smallest_number_with_10_divisors():
    num = 1
    while True:
        if count_divisors(num) == 10:
            return num
        num += 1

result = find_smallest_number_with_10_divisors()
print(result)

